import 'bootstrap/dist/css/bootstrap.min.css';Â 
import { AppProvider } from './context/AppContext';
import * as Components from './components';
import BudgetValue from './components/BudgetValue';
import ExpenseList from './components/ExpenseList';
import DepSelected from './components/DepSelected';
import Location from './components/Location';
import RemBudget from './components/RemBudget';
import SptBudget from './components/SptBudget';

const App=() =>{
  return (
    <AppProvider>
    <div className="container">
      <h1 className="mt-3">Shooping App</h1>
      <div className="row mt-3">
        <div className="col-sm">
          <BudgetValue/>
        </div>
        <div className="col-sm">
          <RemBudget/>
        </div>
        <div className="col-sm">
          <SptBudget/>
        </div>
        <div className="col-sm">
          <Location/>
        </div>
      </div>
      <h3 className="mt-3">Shooping Cart </h3>
      <div className="row mt-3">
        <div className="col-sm">
          <ExpenseList/>
        </div>
      </div>
      <h3 className="mt-3">Add Items</h3>
      <div className="row mt-3">
      <div className="col-sm">
        <DepSelected/>

      </div>
      </div>
      </div>

    </AppProvider>
  );
}

export default App;
